import React, { FC } from 'react';

import { Button, PageHeader } from 'antd';

import 'antd/dist/antd.css';
import './header.scss';

const Header: FC = () => (
  <div className="site-page-header-ghost-wrapper">
    <PageHeader
      ghost={false}
      title="Posts search"
      subTitle="You can work w posts here"
      extra={[<Button>by Name</Button>, <Button>by Title</Button>, <Button>By likes</Button>]}
    ></PageHeader>
  </div>
);

export default Header;
